import React, { Component } from "react";
import Navbar from "../Component/Navbar";
import Section from "../Component/Section";
import Section1 from "../Component/home";
import headshot from "../images/headshot.jpg";
import github from "../images/github.png";

let dummyText = `Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Id nibh tortor id aliquet. Sed lectus vestibulum mattis ullamcorper velit sed. Nec nam aliquam sem et tortor. Elit eget gravida cum sociis natoque. Ipsum a arcu cursus vitae. Massa sapien faucibus et molestie ac feugiat sed. Turpis egestas maecenas pharetra convallis posuere morbi leo. Duis at consectetur lorem donec massa sapien fau`;
let about_text =
  "My name is Mahip Deora, I am currently completing my undergraduate studies in Computer Engineer at the University of Illinois, along with a minor in bussiness. My primary interest lies in Product Management for Software Engineering teams focused on AI, Cloud, Big Data, and Security. I have previous experience in the field of consutling, business development, and data, more information can be found in the section below. ";
let Welcome_text = `Hi welcome to my personal website, below you will find information about my past experinces and project. Thank you for visting and make sure to connect with me`;
export default class NavbarLinker extends Component {
  render() {
    return (
      <div className="NavBarLinker">
        <Navbar />
        <Section
          title="Home"
          subtitle={Welcome_text}
          dark={true}
          id="Home"
          pic1={github}
        />
        <Section1
          title="About"
          subtitle={about_text}
          dark={false}
          id="About"
          img_src={headshot}
          pic1={github}
        />
        <Section
          title="Professional Experience"
          subtitle={dummyText}
          dark={true}
          id="Professional Experience"
        />
        <Section
          title="Extracurriculars"
          subtitle={dummyText}
          dark={false}
          id="Extracurriculars"
        />
      </div>
    );
  }
}
